import { useParams } from "react-router-dom";
import { books } from "../../helpers/cardsList";
import img from "./../../images/imageNotFound.png";
import arrowUp from "./../../images/arrow-up.png";
import arrowDown from "./../../images/arrow-down.png";
import useInput from "./countSinglePrice";


const SpecificBook = () => {

  const [numberInput, setNumberInput, increase, decrease, handleInput, mainPrise, setMainPrise, calculatedPrice] = useInput();

      const {id} = useParams();
      const book = books[id];
      mainPrise = boo

      let imageURL;
      if (book.image) {

          imageURL = book.image;
          } else {
            imageURL = img;
          }

    return ( 

      <div className="spec__book">
        <figure className="figure">
        <img src={imageURL} width="300px" alt="" className="figure__img__spec" />
      </figure>

  <section className="section1">
    <p><span className="book__name">{book.title}</span></p>
    <p><span className="author">{book.author}</span></p>
    <p><span className="book__level">Book level:</span> Beginner</p>
    <p><span className="book__tags">Book tags:</span> core </p>
  </section>

  <section className="right__main">

    <section className="section1__media">
      <p><span className="book__name">{book.title}</span></p>
      <p><span className="author">{book.author}</span></p>
      <p><span className="book__level">Book level:</span> Beginner</p>
      <p><span className="book__tags">Book tags:</span> core</p>
    </section>

  <section className="section__price">

    <ul type="none" className="countedit">
      <li>
         <span>Prise, $</span>
         <span id="singlePrice" className="singlprice">{book.price}</span>
      </li>

      <li>
        <section className="choice__count">            
          <span className="count">Count</span>

          <div className="data__count">
             <input type="number" id="input_number" className="input__number" value={numberInput} onChange={e => handleInput(e.target.value)} />
             <div className="count">
                <img id="arrow_up" className="arrow__up" src={arrowUp} alt="" height="15px" onClick={increase}/>
                <img id="arrow_down" className="arrow__down" src={arrowDown} alt="" height="15px" onClick={decrease} />
            </div>
          </div>
        </section>
      </li>

      <li>
        <span className="total__price__text">Total price</span>
        <span id="totalPrice" className="price">{calculatedPrice}</span>
      </li>

      <li>
        <button type="submit" className="price__btn"><span>Add to cart</span></button>
      </li>
    </ul>

  </section>

</section>
<section className="description">
  <p className="short__description"><span className="description__text">Description:</span> {book.shortDescription}</p>
  <p className="description__content">{book.description}</p>
</section>
</div> );
}

export default SpecificBook;
